import { useCallback, useState } from "react";

export default function UseCallbackTest() {
  const [text, setText] = useState("");

  function capWord(word) {
    setText(word.toUpperCase());
  }

  return (
    <>
      <input
        type="text"
        value={text}
        onChange={(e) => capWord(e.target.value)}
      />
    </>
  );
}
